import React from 'react';
import './navbar.css';
import logoPorto from '../';

function Navbar() {
    return (
      <nav>
        <div className="logo">
          <img src={logoPorto}/>
        </div>
        <ul>
          <li><a href="/">Home</a></li>
          <li><a href="/contato">Contato</a></li>
          <li><a href="/login">Login</a></li>
        </ul>
      </nav>
    );
  }
  
  export default Navbar;
